const Tasks = () => {
    const [tasks, setState] = useState([
        {
            id: 1,
            text: "one",
            day: "M",
            reminder: true
        },
        {
            id: 2,
            text: "two",
            day: "Tu",
            reminder: true
        },
        {
            id: 3,
            text: "three",
            day: "W",
            reminder: true
        },
        {
            id: 4,
            text: "four",
            day: "Th",
            reminder: true
        },
        {
            id: 5,
            text: "five",
            day: "F",
            reminder: true
        }
    ])

    return (
        <>
            {tasks.map((task) => (
                <h3 key={task.id}>{task.text}</h3>
            ))}
        </>
    )
}


export default Tasks;
